import './App.css';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";
import Navbar from './components';
function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path='/about' component={<Navbar/>} ></Route>
          <Route path='/users'></Route>
          <Route path='/'></Route>
        </Switch>
     </div>
    </Router>
  );
}

export default App;
